import React from 'react';
import our from "../../img/Автоматические выплаты иконка.png"
const Our = () => {
    return (
        <div id="our">
            <div className="container">
                <h1 className="our-h1">Наши преимущества</h1>
                <div className="our">
                    <div>
                        <div className="our_block"/>
                        <img src={our} alt=""/>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Our;
